import React, { Component } from 'react';
import './App.css';
import First from './First/First'


class App extends Component {

  state = {
    persons: [
      { name: "Md.Rohan", email: "rohan@gmail.com", address: "Dhanmondi" },
      { name: "Md.Mehedi", email: "mehedi@gmail.com", address: "Lalmohan" },
      { name: "Md.Tanzil", email: "tanzil@gmail.com", address: "Naraynganj" },
      { name: "Md.Tanzil", email: "tanzil@gmail.com", address: "Naraynganj" },
      { name: "Md.Sagor", email: "sagor@gmail.com", address: "Mirpur" }
    ]
  }
  render() {
    return (
      <div className="App">
        {
          this.state.persons.map((people, index) => {
            return < First
              key={index}
              name={people.name}
              email={people.email}
              address={people.address} />
          })
        }
      </div>
    );
  }
}

export default App;
